import React from "react";
import axios from "axios";



export default function FriendInfo(props) {
  const getGenres = (name) => {
    axios.get(`http://localhost:5000/api/${name}/genres`)
    .then(res => {
      console.log(res.data)
    })
  }

  return(
  <main className="favorite-form">{getGenres(props.friend.name)}</main>
  )
}
